#Requires -Version 2

$Divination = ""
$Internment = ""
$Pericardia = ""
$Dogmatists = ""
$Chessboard = ""
$Transcript = ""
$Frequented = ""
$Privatized = ""
$Pinwheeled = ""
$Homophobic = ""
$Promptness = ""
$Diversions = ""
$Channeling = ""
$Implanting = ""
$Intangibly = ""
$Hypnotized = ""
$Simpletons = ""
$Parachuted = ""
$Posteriors = ""
$Capitalize = ""
$Fabricated = ""
$Hospitable = ""
$Complainer = ""
$Treasuries = ""
$Intolerant = ""

$Modules = @($Divination,$Internment,$Pericardia,$Dogmatists,$Chessboard,$Transcript,$Frequented,$Privatized,$Pinwheeled,$Homophobic,$Promptness,$Diversions,$Channeling,$Implanting,$Intangibly,$Hypnotized,$Simpletons,$Parachuted,$Posteriors,$Capitalize,$Fabricated,$Hospitable,$Complainer,$Treasuries,$Intolerant)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
    Remove-Variable -Name "Decoded"
    Remove-Variable -Name "ScriptBlock"
}
Remove-Variable -Name "Modules"
@("Divination","Internment","Pericardia","Dogmatists","Chessboard","Transcript","Frequented","Privatized","Pinwheeled","Homophobic","Promptness","Diversions","Channeling","Implanting","Intangibly","Hypnotized","Simpletons","Parachuted","Posteriors","Capitalize","Fabricated","Hospitable","Complainer","Treasuries","Intolerant") | ForEach-Object { Remove-Variable -Name $_ }
